<tr>
<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ライト・照明&nbsp;&gt;&nbsp;ネイル LEDライト

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【wasser11】wasser LEDデスクライト クランプ<br>
<br>
机を広く使える、スタンド/クランプ兼用LEDデスクライト。<br>
タッチボタンで３パターンの調色、明るさの調整は無段階。<br>
チルト構造と6点のヒンジ（スタンド/クランプ含）_で自由自在な角度調整。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単。<br>
LEDライトなので省電力で長寿命とってもエコに節電対策！<br>
調色機能で、学習机や読書、オフィスにもピッタリ。<br>
電気代を気にせずに長時間使えるデスクスタンドライトです。<br>
目に優しい独自デザインのLED光源です。<br>
<br>
【特徴】<br>
・クランプ/スタンド兼用のデスクライト<br>
・軽く触れるだけでON/OFF/調光/調色が出来るタッチボタン。<br>
・タッチボタンで電球色/昼白色/昼光色の3パターンの調色と無段階調光。<br>
・チルト構造＋6点のヒンジ（スタンド/クランプ含）で自由自在な角度調整可能。<br>
・省エネ、長寿命なLED使用。<br>
・独自デザインのLEDで目に優しい。<br>
・消費電力は最大約8W。<br>
<br>
クランプ対応のLED卓上ライト。ベースのスタンドとクランプは簡単に付け替えが出来る仕様。<br>
独自デザインのLEDで多重影を作りにくくしているので目に優しい光で安心。<br>
無段階の明るさだけでなく、電球色、昼白色、昼光色の3パターンの調色も可能。<br>
15パターンの明かりで長時間ライトを使うビジネスシーンだけでなく、<br>
お子さまのお部屋やリビング等お好みの光の色と明るさを調節していただけます。<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
セードはチルト構造、ヒンジは６箇所(スタンド/クランプ各１箇所含)で固定も出来るので角度調整が自由自在！<br>
場所を選ばない自由度の高さが嬉しいLEDライトです。<br>
<br>
シンプルな角丸のセードと広いベースでやさしい雰囲気のデザイン。<br>
重さはクランプタイプの場合、約600gなので持ち運びも簡単です。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
<br>
規格<br>
サイズ：<br>
本体/最大約H920×W65×D180mm<br>
スタンド/約H55×W155×D220mm<br>
クランプ/約H165×W65×D70mm<br>
<br>
重さ：<br>
本体/約450g<br>
スタンド/約865g<br>
クランプ/約120g<br>
<br>
電源：AC100V 50Hz/60Hz <br>
調光：無段階<br>
光色：3パターン（電球色/昼白色/昼光色）<br>
明るさ：最大約1300Lux(高さ30cmから照射した場合)<br>
消費電力：最大約8W <br>
電源コード：約１.3ｍ<br>
素材：ABS<br>
