【wasser17】wasser LED卓上ライト<br>
<br>
アンティーク調のデザインがレトロでオシャレなLEDデスクライト。<br>
センサーで手をかざすだけでON/OFFができます。<br>
タッチボタンで3パターンの調色と無段階調光が可能。<br>
3箇所の可動部とチルト構造のセード_で自由自在な角度調整。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単。<br>
LEDライトなので省電力で長寿命とってもエコに節電対策！<br>
調色機能で、学習机や読書、オフィスにもピッタリ。<br>
電気代を気にせずに長時間使えるデスクスタンドライトです。<br>
<br>
【特徴】<br>
・アンティークを連想させるレトロなデザイン<br>
・センサーで手をかざすだけでON/OFF可能なデスクライト<br>
・軽く触れるだけでON/OFF/調色/調光が出来るタッチボタン。<br>
・電球色/昼白色/昼光色の3パターンの調色と無段階調光。<br>
・チルト構造のセード＋3箇所の可能部で自由自在な角度調整可能。<br>
・省エネ、長寿命なLED使用。<br>
・独自デザインのLEDで目に優しい。<br>
・消費電力は最大約9W。<br>
<br>
広い机にも対応できるLED卓上ライト。<br>
セードのセンサーで手をかざすだけで電源のON/OFFができて便利。<br>
無段階の明るさだけでなく、電球色、昼白色、昼光色の3パターンの調色も可能。お好みで調節していただけます。<br>
アンティークライトのようなレトロなデザインとカラーがお部屋にアクセント。<br>
高さのあるデスクライトなので床に置いてミニテーブルにも使用しても◎<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
セードはチルト構造、3箇所の可動部で角度調整が自由自在！<br>
場所を選ばない自由度の高さが嬉しいLEDライトです。<br>
<br>
<b>安心設計＆安心価格＆安心保障（１年保証）</b><br>
３つの安心を約束！<br>
<br>
