<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ライト・照明&nbsp;&gt;&nbsp;テーブルランプ・ランタン

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
wasser16 LEDデスクライト<br>
<br>
センサーで手をかざすだけでON/OFFができる、ハイクラスのデスクスタンド。<br>
タッチボタンで3パターンの調色と無段階調光が可能。<br>
3箇所の可動部と3D構造のセード_で自由自在な角度調整。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単。<br>
LEDライトなので省電力で長寿命とってもエコに節電対策！<br>
調色機能で、学習机や読書、オフィスにもピッタリ。<br>
電気代を気にせずに長時間使えるデスクスタンドライトです。<br>
<br>
【特徴】<br>
・センサーで手をかざすだけでON/OFF可能なデスクライト<br>
・軽く触れるだけで調色/調光が出来るタッチボタン。<br>
・電球色/昼白色/昼光色の3パターンの調色と無段階調光。<br>
・3D構造のセード＋3箇所の可能部で自由自在な角度調整可能。<br>
・省エネ、長寿命なLED照明。<br>
・独自デザインのLEDで目に優しい。<br>
・消費電力は最大約10W。<br>
<br>
広い机にも対応できる卓上ライト。<br>
無段階の明るさだけでなく、電球色、昼白色、昼光色の3パターンの調色も可能。お好みのライトへ調節していただけます。<br>
ブラック/ホワイトのスタンダードなカラーに、シルバーの細身のアームがクールな印象を与えるのでオフィス・ワークデスクに置いても違和感のない洗練されたデザイン。<br>
テーブルライトなので床に置いてスタンドライトにとして使用しても◎<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
セードは3D構造、3箇所の可動部で角度調整が自由自在！<br>
場所を選ばない自由度の高さが嬉しいLEDデスクライトです。<br>
<br>
<b>安心設計＆安心価格＆安心保障（１年保証）</b><br>
３つの安心を約束！<br>
<br>
カラー：ブラック/ホワイト<br>
<br>
規格<br>
サイズ：<br>
本体/約H520×W120×D470mm<br>
ベース/約H50×W177×D210mm<br>
<br>
重さ：<br>
本体/約310g<br>
ベース/約1037g<br>
<br>
電源：AC100V-240V 50Hz/60Hz <br>
調光：無段階<br>
光色：3パターン（電球色/昼白色/昼光色）<br>
明るさ：最大約1300Lux(高さ30cmから照射した場合)<br>
消費電力：最大約10W <br>
電源コード：約１.46ｍ<br>
素材：ABS<br>
