メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
Wsser06 LEDクリップライト<br>
挟んだり、置いたり、さまざまな場所に設置できる<strong>クリップライト</strong><br>
【特徴】<br>
・３段階の調光<br>
・シンプルなデザイン<br>
・軽く触れるだけでON/OFFができるタッチスイッチ（タッチセンサーライト）<br>
・LED電球は省エネ長寿命<br>
・消費電力は、わずか6W<br>
・直接照明としても間接照明としても使えます<br>
<br>
規格<br>
調光：3段階<br>
消費電力：約6W<br>
電源コード：約1.8ｍ<br>
重さ：約274g<br>
電源：AC100V 50Hz/60Hz<br>

<br>
【 操作方法 】<br>
・セードの電源マークを軽くタッチでONと調光ができます。<br>
・OFFにする際はセードの電源マークを長押ししてください。<br>
<br>
注意事項<br>
・光源を直視しないでください。<br>
目に悪影響を及ぼす恐れがあります。<br>
・ラジオ、テレビや赤外線リモコン方式の機器から離してご使用ください。<br>
雑音が入ったり、正常に動作しない場合があります。<br>
・LED光源にはバラツキがあるため、<br>
同じ形名商品でも商品ごとに発光色、<br>
明るさが異なる場合がありますのでご了承ください。
<br><br>
<b>安心設計＆安心価格＆安心保障（１年保証）
 ３つの安心を約束！</b>
